import { Image } from "react-bootstrap";
import "./Nav.scss";

function Nav() {
  return (
    <div className="top">
      <Image className="mainLogo" src="image/kbmain.png" />
      <div>안녕하세요 도깨비님</div>
    </div>
  );
}

export default Nav;
